webpackJsonp([24234323058979],{6680:function(e,t){e.exports={data:{post:{html:'<p>My home town in Minnesota is exactly 1 mile square, so it almost completely fits on this 1500x1500m picture from <a title="ACME Mapper" href="http://mapper.acme.com/">ACME Mapper</a> (as seen at <a title="Don Park\'s Daily Habit - Home from Space" href="http://www.docuverse.com/blog/donpark/EntryViewPage.aspx?guid=685c89e8-7c87-4b1f-96bb-2321305349f3">Don Park</a>). Outside the town are just prairie fields. I spent pretty much my entire high school years within this square.  (Well, not entirely... otherwise I never would have met this German girl I later married....)</p>\n<p><img alt="luftbild.jpeg" src="http://www.papascott.de/fotos/luftbild.jpeg" width="405" height="400" border="0" /></p>',fields:{title:"Square",date:"15 Feb 2004",url:"https://papascott.de/2004-02-15-square/"}}},pathContext:{slug:"/2004-02-15-square/",prev:{fields:{title:"Fear and change",date:"15 Feb 2004",slug:"/2004-02-15-fear-and-change/"}},next:{fields:{title:"A Manual for Germany",date:"16 Feb 2004",slug:"/2004-02-16-a-manual-for-germany/"}}}}}});
